    true,nt"url": null,nt"notes": "Led by USAID, Feed the Future is the U.S.
    Government?s global hunger and food security initiative, which establishes a foundation
    for lasting progress against global hunger. (See the individual entries to retrieve
    data for the country surveys.) With a focus on smallholder farmers, particularly
    women, Feed the Future supports partner countries in developing their agriculture
    sectors to spur economic growth that increases incomes and reduces hunger, poverty
    and undernutrition. Focus countries in the Feed the Future initiative administer
    baseline surveys to: establish the starting point for indicators to be used for
    program monitoring and evaluation, reveal information about the nature, magnitude
    and severity of problems to be addressed, serve as the basis for determining appropriate
    amounts of intervention, and determine targets for selected indicators of program
